import React from "react";
import Markdown from "markdown-to-jsx";
import { Link } from '@material-ui/core';


const Contact = () => {
    return (
    <div>

        <h1>Kontaktuppgifter</h1>

        <Typography>
         Mail: fredrik.fischer@protonmail.com
        </Typography>
        <Typography>
         Github: https://github.com/fredrikfischer
        </Typography>
        
        
   
    </div>
    )
    
}

export {Contact}
